class stack
{
int a[9];
int top;
public:
    stack()
    {
        top=0;
    }
    void push(int n)
    {
        a[top++]=n;
    }
    long long int pop()
    { return a[--top];
    }
    long long int num_formed()
    {   long long int num=0;
        for(int i=0;i<top;i++)
        {
            num=num*10+a[i];
        }
        return num;
    }
    void clearstack()
    {top=0;}
}s;

